import * as types from '../constants/actionTypes';
import { educationGet } from '../services/backend';

export const educationGetAction = () => async (dispatch) => {
  dispatch({
    type: types.EDUCATION_GET
  });

  try {
    const { data } = await educationGet();

    return dispatch({
      type: types.EDUCATION_GET_SUCCEED,
      data: data.data,
      count: data.count
    });
  } catch(err) {
    return dispatch({
      type: types.EDUCATION_GET_FAILED
    });
  }
};
